@group("Start triggers") @timetrue("60") @timetruetype("clock")
StartTrigger := lcShutdownCode <> "no fault present" and not Contains(lcShutdownCode, "comm fail") and lcRunStatus <> "standby";

@group("End triggers")
EndTrigger := lcShutdownCode = "no fault present";

SecPerDay := 60*60*24;
SecPerWeek := SecPerDay * 7;
